// A MatchOption configures a Matcher.
type unfold5__MatchOption func(*unfold5__matcher)

// PreferSameScript will, in the absence of a match, result in the first
// preferred tag with the same script as a supported tag to match this supported
// tag. The default is currently true, but this may change in the future.
func unfold5__PreferSameScript(preferSame bool) unfold5__MatchOption {
	return func(m *unfold5__matcher) { m.preferSameScript = preferSame }
}

// TODO(v1.0.0): consider making Matcher a concrete type, instead of interface.
// There doesn't seem to be too much need for multiple types.
// Making it a concrete type allows MatchStrings to be a method, which will
// improve its discoverability.

// MatchStrings parses and matches the given strings until one of them matches
// the language in the Matcher. A string may be an Accept-Language header as
// handled by ParseAcceptLanguage. The default language is returned if no
// other language matched.
func unfold5__MatchStrings(m unfold5__Matcher, lang ...string) (tag unfold5__Tag, index int) {
	for _, accept := range lang {
		desired, _, err := unfold5__ParseAcceptLanguage(accept)
		if err != nil {
			continue
		}
		if tag, index, conf := m.Match(desired...); conf != unfold5__No {
			return tag, index
		}
	}
	tag, index, _ = m.Match()
	return
}

// Matcher is the interface that wraps the Match method.
//
// Match returns the best match for any of the given tags, along with
// a unique index associated with the returned tag and a confidence
// score.
type unfold5__Matcher interface {
	Match(t ...unfold5__Tag) (tag unfold5__Tag, index int, c unfold5__Confidence)
}

// Comprehends reports the confidence score for a speaker of a given language
// to being able to comprehend the written form of an alternative language.
func unfold5__Comprehends(speaker, alternative unfold5__Tag) unfold5__Confidence {
	_, _, c := unfold5__NewMatcher([]unfold5__Tag{alternative}).Match(speaker)
	return c
}

// NewMatcher returns a Matcher that matches an ordered list of preferred tags
// against a list of supported tags based on written intelligibility, closeness
// of dialect, equivalence of subtags and various other rules. It is initialized
// with the list of supported tags. The first element is used as the default
// value in case no match is found.
//
// Its Match method matches the first of the given Tags to reach a certain
// confidence threshold. The tags passed to Match should therefore be specified
// in order of preference. Extensions are ignored for matching.
//
// The index returned by the Match method corresponds to the index of the
// matched tag in t, but is augmented with the Unicode extension ('u')of the
// corresponding preferred tag. This allows user locale options to be passed
// transparently.
func unfold5__NewMatcher(t []unfold5__Tag, options ...unfold5__MatchOption) unfold5__Matcher {
	return unfold5__newMatcher(t, options)
}

func (m *unfold5__matcher) Match(want ...unfold5__Tag) (t unfold5__Tag, index int, c unfold5__Confidence) {
	match, w, c := m.getBest(want...)
	if match != nil {
		t, index = match.tag, match.index
	} else {
		// TODO: this should be an option
		t = m.default_.tag
		if m.preferSameScript {
		outer:
			for _, w := range want {
				script, _ := w.Script()
				if script.unfold5__scriptID == 0 {
					// Don't do anything if there is no script, such as with
					// private subtags.
					continue
				}
				for i, h := range m.supported {
					if script.unfold5__scriptID == h.maxScript {
						t, index = h.tag, i
						break outer
					}
				}
			}
		}
		// TODO: select first language tag based on script.
	}
	if w.region != 0 && t.region != 0 && t.region.contains(w.region) {
		t, _ = unfold5__Raw.Compose(t, unfold5__Region{w.region})
	}
	// Copy options from the user-provided tag into the result tag. This is hard
	// to do after the fact, so we do it here.
	// TODO: add in alternative variants to -u-va-.
	// TODO: add preferred region to -u-rg-.
	if e := w.Extensions(); len(e) > 0 {
		t, _ = unfold5__Raw.Compose(t, e)
	}
	return t, index, c
}

type unfold5__scriptRegionFlags uint8

const (
	unfold5__isList = 1 << iota
	unfold5__scriptInFrom
	unfold5__regionInFrom
)

func (t *unfold5__Tag) setUndefinedLang(id unfold5__langID) {
	if t.lang == 0 {
		t.lang = id
	}
}

func (t *unfold5__Tag) setUndefinedScript(id unfold5__scriptID) {
	if t.script == 0 {
		t.script = id
	}
}

func (t *unfold5__Tag) setUndefinedRegion(id unfold5__regionID) {
	if t.region == 0 || t.region.contains(id) {
		t.region = id
	}
}

// ErrMissingLikelyTagsData indicates no information was available
// to compute likely values of missing tags.
var unfold5__ErrMissingLikelyTagsData = retain2.New("missing likely tags data")

// addLikelySubtags sets subtags to their most likely value, given the locale.
// In most cases this means setting fields for unknown values, but in some
// cases it may alter a value.  It returns an ErrMissingLikelyTagsData error
// if the given locale cannot be expanded.
func (t unfold5__Tag) addLikelySubtags() (unfold5__Tag, error) {
	id, err := unfold5__addTags(t)
	if err != nil {
		return t, err
	} else if id.equalTags(t) {
		return t, nil
	}
	id.remakeString()
	return id, nil
}

// specializeRegion attempts to specialize a group region.
func unfold5__specializeRegion(t *unfold5__Tag) bool {
	if i := unfold5__regionInclusion[t.region]; i < unfold5__nRegionGroups {
		x := unfold5__likelyRegionGroup[i]
		if unfold5__langID(x.lang) == t.lang && unfold5__scriptID(x.script) == t.script {
			t.region = unfold5__regionID(x.region)
		}
		return true
	}
	return false
}

func unfold5__addTags(t unfold5__Tag) (unfold5__Tag, error) {
	// We leave private use identifiers alone.
	if t.private() {
		return t, nil
	}
	if t.script != 0 && t.region != 0 {
		if t.lang != 0 {
			// already fully specified
			unfold5__specializeRegion(&t)
			return t, nil
		}
		// Search matches for und-script-region. Note that for these cases
		// region will never be a group so there is no need to check for this.
		list := unfold5__likelyRegion[t.region : t.region+1]
		if x := list[0]; x.flags&unfold5__isList != 0 {
			list = unfold5__likelyRegionList[x.lang : x.lang+uint16(x.script)]
		}
		for _, x := range list {
			// Deviating from the spec. See match_test.go for details.
			if unfold5__scriptID(x.script) == t.script {
				t.setUndefinedLang(unfold5__langID(x.lang))
				return t, nil
			}
		}
	}
	if t.lang != 0 {
		// Search matches for lang-script and lang-region, where lang != und.
		if t.lang < unfold5__langNoIndexOffset {
			x := unfold5__likelyLang[t.lang]
			if x.flags&unfold5__isList != 0 {
				list := unfold5__likelyLangList[x.region : x.region+uint16(x.script)]
				if t.script != 0 {
					for _, x := range list {
						if unfold5__scriptID(x.script) == t.script && x.flags&unfold5__scriptInFrom != 0 {
							t.setUndefinedRegion(unfold5__regionID(x.region))
							return t, nil
						}
					}
				} else if t.region != 0 {
					count := 0
					goodScript := true
					tt := t
					for _, x := range list {
						// We visit all entries for which the script was not
						// defined, including the ones where the region was not
						// defined. This allows for proper disambiguation within
						// regions.
						if x.flags&unfold5__scriptInFrom == 0 && t.region.contains(unfold5__regionID(x.region)) {
							tt.region = unfold5__regionID(x.region)
							tt.setUndefinedScript(unfold5__scriptID(x.script))
							goodScript = goodScript && tt.script == unfold5__scriptID(x.script)
							count++
						}
					}
					if count == 1 {
						return tt, nil
					}
					// Even if we fail to find a unique Region, we might have
					// an unambiguous script.
					if goodScript {
						t.script = tt.script
					}
				}
			}
		}
	} else {
		// Search matches for und-script.
		if t.script != 0 {
			x := unfold5__likelyScript[t.script]
			if x.region != 0 {
				t.setUndefinedRegion(unfold5__regionID(x.region))
				t.setUndefinedLang(unfold5__langID(x.lang))
				return t, nil
			}
		}
		// Search matches for und-region. If und-script-region exists, it would
		// have been found earlier.
		if t.region != 0 {
			if i := unfold5__regionInclusion[t.region]; i < unfold5__nRegionGroups {
				x := unfold5__likelyRegionGroup[i]
				if x.region != 0 {
					t.setUndefinedLang(unfold5__langID(x.lang))
					t.setUndefinedScript(unfold5__scriptID(x.script))
					t.region = unfold5__regionID(x.region)
				}
			} else {
				x := unfold5__likelyRegion[t.region]
				if x.flags&unfold5__isList != 0 {
					x = unfold5__likelyRegionList[x.lang]
				}
				if x.script != 0 && x.flags != unfold5__scriptInFrom {
					t.setUndefinedLang(unfold5__langID(x.lang))
					t.setUndefinedScript(unfold5__scriptID(x.script))
					return t, nil
				}
			}
		}
	}

	// Search matches for lang.
	if t.lang < unfold5__langNoIndexOffset {
		x := unfold5__likelyLang[t.lang]
		if x.flags&unfold5__isList != 0 {
			x = unfold5__likelyLangList[x.region]
		}
		if x.region != 0 {
			t.setUndefinedScript(unfold5__scriptID(x.script))
			t.setUndefinedRegion(unfold5__regionID(x.region))
		}
		unfold5__specializeRegion(&t)
		if t.lang == 0 {
			t.lang = unfold5___en // default language
		}
		return t, nil
	}
	return t, unfold5__ErrMissingLikelyTagsData
}

func (t *unfold5__Tag) setTagsFrom(id unfold5__Tag) {
	t.lang = id.lang
	t.script = id.script
	t.region = id.region
}

// minimize removes the region or script subtags from t such that
// t.addLikelySubtags() == t.minimize().addLikelySubtags().
func (t unfold5__Tag) minimize() (unfold5__Tag, error) {
	t, err := unfold5__minimizeTags(t)
	if err != nil {
		return t, err
	}
	t.remakeString()
	return t, nil
}

// minimizeTags mimics the behavior of the ICU 51 C implementation.
func unfold5__minimizeTags(t unfold5__Tag) (unfold5__Tag, error) {
	if t.equalTags(unfold5__und) {
		return t, nil
	}
	max, err := unfold5__addTags(t)
	if err != nil {
		return t, err
	}
	for _, id := range [...]unfold5__Tag{
		{lang: t.lang},
		{lang: t.lang, region: t.region},
		{lang: t.lang, script: t.script},
	} {
		if x, err := unfold5__addTags(id); err == nil && max.equalTags(x) {
			t.setTagsFrom(id)
			break
		}
	}
	return t, nil
}

// Tag Matching
// CLDR defines an algorithm for finding the best match between two sets of language
// tags. The basic algorithm defines how to score a possible match and then find
// the match with the best score
// (see http://www.unicode.org/reports/tr35/#LanguageMatching).
// Using scoring has several disadvantages. The scoring obfuscates the importance of
// the various factors considered, making the algorithm harder to understand. Using
// scoring also requires the full score to be computed for each pair of tags.
//
// We will use a different algorithm which aims to have the following properties:
// - clarity on the precedence of the various selection factors, and
// - improved performance by allowing early termination of a comparison.
//
// Matching algorithm (overview)
// Input:
//   - supported: a set of supported tags
//   - default:   the default tag to return in case there is no match
//   - desired:   list of desired tags, ordered by preference, starting with
//                the most-preferred.
//
// Algorithm:
//   1) Set the best match to the lowest confidence level
//   2) For each tag in "desired":
//     a) For each tag in "supported":
//        1) compute the match between the two tags.
//        2) if the match is better than the previous best match, replace it
//           with the new match. (see next section)
//     b) if the current best match is Exact and pin is true the result will be
//        frozen to the language found thusfar, although better matches may
//        still be found for the same language.
//   3) If the best match so far is below a certain threshold, return "default".
//
// Ranking:
// We use two phases to determine whether one pair of tags are a better match
// than another pair of tags. First, we determine a rough confidence level. If the
// levels are different, the one with the highest confidence wins.
// Second, if the rough confidence levels are identical, we use a set of tie-breaker
// rules.
//
// The confidence level of matching a pair of tags is determined by finding the
// lowest confidence level of any matches of the corresponding subtags (the
// result is deemed as good as its weakest link).
// We define the following levels:
//   Exact    - An exact match of a subtag, before adding likely subtags.
//   MaxExact - An exact match of a subtag, after adding likely subtags.
//              [See Note 2].
//   High     - High level of mutual intelligibility between different subtag
//              variants.
//   Low      - Low level of mutual intelligibility between different subtag
//              variants.
//   No       - No mutual intelligibility.
//
// The following levels can occur for each type of subtag:
//   Base:    Exact, MaxExact, High, Low, No
//   Script:  Exact, MaxExact [see Note 3], Low, No
//   Region:  Exact, MaxExact, High
//   Variant: Exact, High
//   Private: Exact, No
//
// Any result with a confidence level of Low or higher is deemed a possible match.
// Once a desired tag matches any of the supported tags with a level of MaxExact
// or higher, the next desired tag is not considered (see Step 2.b).
// Note that CLDR provides languageMatching data that defines close equivalence
// classes for base languages, scripts and regions.
//
// Tie-breaking
// If we get the same confidence level for two matches, we apply a sequence of
// tie-breaking rules. The first that succeeds defines the result. The rules are
// applied in the following order.
//   1) Original language was defined and was identical.
//   2) Original region was defined and was identical.
//   3) Distance between two maximized regions was the smallest.
//   4) Original script was defined and was identical.
//   5) Distance from want tag to have tag using the parent relation [see Note 5.]
// If there is still no winner after these rules are applied, the first match
// found wins.
//
// Notes:
// [2] In practice, as matching of Exact is done in a separate phase from
//     matching the other levels, we reuse the Exact level to mean MaxExact in
//     the second phase. As a consequence, we only need the levels defined by
//     the Confidence type. The MaxExact confidence level is mapped to High in
//     the public API.
// [3] We do not differentiate between maximized script values that were derived
//     from suppressScript versus most likely tag data. We determined that in
//     ranking the two, one ranks just after the other. Moreover, the two cannot
//     occur concurrently. As a consequence, they are identical for practical
//     purposes.
// [4] In case of deprecated, macro-equivalents and legacy mappings, we assign
//     the MaxExact level to allow iw vs he to still be a closer match than
//     en-AU vs en-US, for example.
// [5] In CLDR a locale inherits fields that are unspecified for this locale
//     from its parent. Therefore, if a locale is a parent of another locale,
//     it is a strong measure for closeness, especially when no other tie
//     breaker rule applies. One could also argue it is inconsistent, for
//     example, when pt-AO matches pt (which CLDR equates with pt-BR), even
//     though its parent is pt-PT according to the inheritance rules.
//
// Implementation Details:
// There are several performance considerations worth pointing out. Most notably,
// we preprocess as much as possible (within reason) at the time of creation of a
// matcher. This includes:
//   - creating a per-language map, which includes data for the raw base language
//     and its canonicalized variant (if applicable),
//   - expanding entries for the equivalence classes defined in CLDR's
//     languageMatch data.
// The per-language map ensures that typically only a very small number of tags
// need to be considered. The pre-expansion of canonicalized subtags and
// equivalence classes reduces the amount of map lookups that need to be done at
// runtime.

// matcher keeps a set of supported language tags, indexed by language.
type unfold5__matcher struct {
	default_         *unfold5__haveTag
	supported        []*unfold5__haveTag
	index            map[unfold5__langID]*unfold5__matchHeader
	passSettings     bool
	preferSameScript bool
}

// matchHeader has the lists of tags for exact matches and matches based on
// maximized and canonicalized tags for a given language.
type unfold5__matchHeader struct {
	haveTags []*unfold5__haveTag
	original bool
}

// haveTag holds a supported Tag and its maximized script and region. The maximized
// or canonicalized language is not stored as it is not needed during matching.
type unfold5__haveTag struct {
	tag unfold5__Tag

	// index of this tag in the original list of supported tags.
	index int

	// conf is the maximum confidence that can result from matching this haveTag.
	// When conf < Exact this means it was inserted after applying a CLDR equivalence rule.
	conf unfold5__Confidence

	// Maximized region and script.
	maxRegion unfold5__regionID
	maxScript unfold5__scriptID

	// altScript may be checked as an alternative match to maxScript. If altScript
	// matches, the confidence level for this match is Low. Theoretically there
	// could be multiple alternative scripts. This does not occur in practice.
	altScript unfold5__scriptID

	// nextMax is the index of the next haveTag with the same maximized tags.
	nextMax uint16
}

func unfold5__makeHaveTag(tag unfold5__Tag, index int) (unfold5__haveTag, unfold5__langID) {
	max := tag
	if tag.lang != 0 || tag.region != 0 || tag.script != 0 {
		max, _ = max.canonicalize(unfold5__All)
		max, _ = unfold5__addTags(max)
		max.remakeString()
	}
	return unfold5__haveTag{tag, index, unfold5__Exact, max.region, max.script, unfold5__altScript(max.lang, max.script), 0}, max.lang
}

// altScript returns an alternative script that may match the given script with
// a low confidence.  At the moment, the langMatch data allows for at most one
// script to map to another and we rely on this to keep the code simple.
func unfold5__altScript(l unfold5__langID, s unfold5__scriptID) unfold5__scriptID {
	for _, alt := range unfold5__matchScript {
		// TODO: also match cases where language is not the same.
		if (unfold5__langID(alt.wantLang) == l || unfold5__langID(alt.haveLang) == l) &&
			unfold5__scriptID(alt.haveScript) == s {
			return unfold5__scriptID(alt.wantScript)
		}
	}
	return 0
}

// addIfNew adds a haveTag to the list of tags only if it is a unique tag.
// Tags that have the same maximized values are linked by index.
func (h *unfold5__matchHeader) addIfNew(n unfold5__haveTag, exact bool) {
	h.original = h.original || exact
	// Don't add new exact matches.
	for _, v := range h.haveTags {
		if v.tag.equalsRest(n.tag) {
			return
		}
	}
	// Allow duplicate maximized tags, but create a linked list to allow quickly
	// comparing the equivalents and bail out.
	for i, v := range h.haveTags {
		if v.maxScript == n.maxScript &&
			v.maxRegion == n.maxRegion &&
			v.tag.variantOrPrivateTagStr() == n.tag.variantOrPrivateTagStr() {
			for h.haveTags[i].nextMax != 0 {
				i = int(h.haveTags[i].nextMax)
			}
			h.haveTags[i].nextMax = uint16(len(h.haveTags))
			break
		}
	}
	h.haveTags = append(h.haveTags, &n)
}

// header returns the matchHeader for the given language. It creates one if
// it doesn't already exist.
func (m *unfold5__matcher) header(l unfold5__langID) *unfold5__matchHeader {
	if h := m.index[l]; h != nil {
		return h
	}
	h := &unfold5__matchHeader{}
	m.index[l] = h
	return h
}

func unfold5__toConf(d uint8) unfold5__Confidence {
	if d <= 10 {
		return unfold5__High
	}
	if d < 30 {
		return unfold5__Low
	}
	return unfold5__No
}

// newMatcher builds an index for the given supported tags and returns it as
// a matcher. It also expands the index by considering various equivalence classes
// for a given tag.
func unfold5__newMatcher(supported []unfold5__Tag, options []unfold5__MatchOption) *unfold5__matcher {
	m := &unfold5__matcher{
		index:            make(map[unfold5__langID]*unfold5__matchHeader),
		preferSameScript: true,
	}
	for _, o := range options {
		o(m)
	}
	if len(supported) == 0 {
		m.default_ = &unfold5__haveTag{}
		return m
	}
	// Add supported languages to the index. Add exact matches first to give
	// them precedence.
	for i, tag := range supported {
		pair, _ := unfold5__makeHaveTag(tag, i)
		m.header(tag.lang).addIfNew(pair, true)
		m.supported = append(m.supported, &pair)
	}
	m.default_ = m.header(supported[0].lang).haveTags[0]
	// Keep these in two different loops to support the case that two equivalent
	// languages are distinguished, such as iw and he.
	for i, tag := range supported {
		pair, max := unfold5__makeHaveTag(tag, i)
		if max != tag.lang {
			m.header(max).addIfNew(pair, true)
		}
	}

	// update is used to add indexes in the map for equivalent languages.
	// update will only add entries to original indexes, thus not computing any
	// transitive relations.
	update := func(want, have uint16, conf unfold5__Confidence) {
		if hh := m.index[unfold5__langID(have)]; hh != nil {
			if !hh.original {
				return
			}
			hw := m.header(unfold5__langID(want))
			for _, ht := range hh.haveTags {
				v := *ht
				if conf < v.conf {
					v.conf = conf
				}
				v.nextMax = 0 // this value needs to be recomputed
				if v.altScript != 0 {
					v.altScript = unfold5__altScript(unfold5__langID(want), v.maxScript)
				}
				hw.addIfNew(v, conf == unfold5__Exact && hh.original)
			}
		}
	}

	// Add entries for languages with mutual intelligibility as defined by CLDR's
	// languageMatch data.
	for _, ml := range unfold5__matchLang {
		update(ml.want, ml.have, unfold5__toConf(ml.distance))
		if !ml.oneway {
			update(ml.have, ml.want, unfold5__toConf(ml.distance))
		}
	}

	// Add entries for possible canonicalizations. This is an optimization to
	// ensure that only one map lookup needs to be done at runtime per desired tag.
	// First we match deprecated equivalents. If they are perfect equivalents
	// (their canonicalization simply substitutes a different language code, but
	// nothing else), the match confidence is Exact, otherwise it is High.
	for i, lm := range unfold5__langAliasMap {
		// If deprecated codes match and there is no fiddling with the script or
		// or region, we consider it an exact match.
		conf := unfold5__Exact
		if unfold5__langAliasTypes[i] != unfold5__langMacro {
			if !unfold5__isExactEquivalent(unfold5__langID(lm.from)) {
				conf = unfold5__High
			}
			update(lm.to, lm.from, conf)
		}
		update(lm.from, lm.to, conf)
	}
	return m
}

// getBest gets the best matching tag in m for any of the given tags, taking into
// account the order of preference of the given tags.
func (m *unfold5__matcher) getBest(want ...unfold5__Tag) (got *unfold5__haveTag, orig unfold5__Tag, c unfold5__Confidence) {
	best := unfold5__bestMatch{}
	for i, w := range want {
		var max unfold5__Tag
		// Check for exact match first.
		h := m.index[w.lang]
		if w.lang != 0 {
			if h == nil {
				continue
			}
			// Base language is defined.
			max, _ = w.canonicalize(unfold5__Legacy | unfold5__Deprecated | unfold5__Macro)
			// A region that is added through canonicalization is stronger than
			// a maximized region: set it in the original (e.g. mo -> ro-MD).
			if w.region != max.region {
				w.region = max.region
			}
			// TODO: should we do the same for scripts?
			// See test case: en, sr, nl ; sh ; sr
			max, _ = unfold5__addTags(max)
		} else {
			// Base language is not defined.
			if h != nil {
				for i := range h.haveTags {
					have := h.haveTags[i]
					if have.tag.equalsRest(w) {
						return have, w, unfold5__Exact
					}
				}
			}
			if w.script == 0 && w.region == 0 {
				// We skip all tags matching und for approximate matching, including
				// private tags.
				continue
			}
			max, _ = unfold5__addTags(w)
			if h = m.index[max.lang]; h == nil {
				continue
			}
		}
		pin := true
		for _, t := range want[i+1:] {
			if w.lang == t.lang {
				pin = false
				break
			}
		}
		// Check for match based on maximized tag.
		for i := range h.haveTags {
			have := h.haveTags[i]
			best.update(have, w, max.script, max.region, pin)
			if best.conf == unfold5__Exact {
				for have.nextMax != 0 {
					have = h.haveTags[have.nextMax]
					best.update(have, w, max.script, max.region, pin)
				}
				return best.have, best.want, best.conf
			}
		}
	}
	if best.conf <= unfold5__No {
		if len(want) != 0 {
			return nil, want[0], unfold5__No
		}
		return nil, unfold5__Tag{}, unfold5__No
	}
	return best.have, best.want, best.conf
}

// bestMatch accumulates the best match so far.
type unfold5__bestMatch struct {
	have            *unfold5__haveTag
	want            unfold5__Tag
	conf            unfold5__Confidence
	pinnedRegion    unfold5__regionID
	pinLanguage     bool
	sameRegionGroup bool
	// Cached results from applying tie-breaking rules.
	origLang     bool
	origReg      bool
	paradigmReg  bool
	regGroupDist uint8
	origScript   bool
}

// update updates the existing best match if the new pair is considered to be a
// better match. To determine if the given pair is a better match, it first
// computes the rough confidence level. If this surpasses the current match, it
// will replace it and update the tie-breaker rule cache. If there is a tie, it
// proceeds with applying a series of tie-breaker rules. If there is no
// conclusive winner after applying the tie-breaker rules, it leaves the current
// match as the preferred match.
//
// If pin is true and have and tag are a strong match, it will henceforth only
// consider matches for this language. This corresponds to the nothing that most
// users have a strong preference for the first defined language. A user can
// still prefer a second language over a dialect of the preferred language by
// explicitly specifying dialects, e.g. "en, nl, en-GB". In this case pin should
// be false.
func (m *unfold5__bestMatch) update(have *unfold5__haveTag, tag unfold5__Tag, maxScript unfold5__scriptID, maxRegion unfold5__regionID, pin bool) {
	// Bail if the maximum attainable confidence is below that of the current best match.
	c := have.conf
	if c < m.conf {
		return
	}
	// Don't change the language once we already have found an exact match.
	if m.pinLanguage && tag.lang != m.want.lang {
		return
	}
	// Pin the region group if we are comparing tags for the same language.
	if tag.lang == m.want.lang && m.sameRegionGroup {
		_, sameGroup := unfold5__regionGroupDist(m.pinnedRegion, have.maxRegion, have.maxScript, m.want.lang)
		if !sameGroup {
			return
		}
	}
	if c == unfold5__Exact && have.maxScript == maxScript {
		// If there is another language and then another entry of this language,
		// don't pin anything, otherwise pin the language.
		m.pinLanguage = pin
	}
	if have.tag.equalsRest(tag) {
	} else if have.maxScript != maxScript {
		// There is usually very little comprehension between different scripts.
		// In a few cases there may still be Low comprehension. This possibility
		// is pre-computed and stored in have.altScript.
		if unfold5__Low < m.conf || have.altScript != maxScript {
			return
		}
		c = unfold5__Low
	} else if have.maxRegion != maxRegion {
		if unfold5__High < c {
			// There is usually a small difference between languages across regions.
			c = unfold5__High
		}
	}

	// We store the results of the computations of the tie-breaker rules along
	// with the best match. There is no need to do the checks once we determine
	// we have a winner, but we do still need to do the tie-breaker computations.
	// We use "beaten" to keep track if we still need to do the checks.
	beaten := false // true if the new pair defeats the current one.
	if c != m.conf {
		if c < m.conf {
			return
		}
		beaten = true
	}

	// Tie-breaker rules:
	// We prefer if the pre-maximized language was specified and identical.
	origLang := have.tag.lang == tag.lang && tag.lang != 0
	if !beaten && m.origLang != origLang {
		if m.origLang {
			return
		}
		beaten = true
	}

	// We prefer if the pre-maximized region was specified and identical.
	origReg := have.tag.region == tag.region && tag.region != 0
	if !beaten && m.origReg != origReg {
		if m.origReg {
			return
		}
		beaten = true
	}

	regGroupDist, sameGroup := unfold5__regionGroupDist(have.maxRegion, maxRegion, maxScript, tag.lang)
	if !beaten && m.regGroupDist != regGroupDist {
		if regGroupDist > m.regGroupDist {
			return
		}
		beaten = true
	}

	paradigmReg := unfold5__isParadigmLocale(tag.lang, have.maxRegion)
	if !beaten && m.paradigmReg != paradigmReg {
		if !paradigmReg {
			return
		}
		beaten = true
	}

	// Next we prefer if the pre-maximized script was specified and identical.
	origScript := have.tag.script == tag.script && tag.script != 0
	if !beaten && m.origScript != origScript {
		if m.origScript {
			return
		}
		beaten = true
	}

	// Update m to the newly found best match.
	if beaten {
		m.have = have
		m.want = tag
		m.conf = c
		m.pinnedRegion = maxRegion
		m.sameRegionGroup = sameGroup
		m.origLang = origLang
		m.origReg = origReg
		m.paradigmReg = paradigmReg
		m.origScript = origScript
		m.regGroupDist = regGroupDist
	}
}

func unfold5__isParadigmLocale(lang unfold5__langID, r unfold5__regionID) bool {
	for _, e := range unfold5__paradigmLocales {
		if unfold5__langID(e[0]) == lang && (r == unfold5__regionID(e[1]) || r == unfold5__regionID(e[2])) {
			return true
		}
	}
	return false
}

// regionGroupDist computes the distance between two regions based on their
// CLDR grouping.
func unfold5__regionGroupDist(a, b unfold5__regionID, script unfold5__scriptID, lang unfold5__langID) (dist uint8, same bool) {
	const defaultDistance = 4

	aGroup := uint(unfold5__regionToGroups[a]) << 1
	bGroup := uint(unfold5__regionToGroups[b]) << 1
	for _, ri := range unfold5__matchRegion {
		if unfold5__langID(ri.lang) == lang && (ri.script == 0 || unfold5__scriptID(ri.script) == script) {
			group := uint(1 << (ri.group &^ 0x80))
			if 0x80&ri.group == 0 {
				if aGroup&bGroup&group != 0 { // Both regions are in the group.
					return ri.distance, ri.distance == defaultDistance
				}
			} else {
				if (aGroup|bGroup)&group == 0 { // Both regions are not in the group.
					return ri.distance, ri.distance == defaultDistance
				}
			}
		}
	}
	return defaultDistance, true
}

func (t unfold5__Tag) variants() string {
	if t.pVariant == 0 {
		return ""
	}
	return t.str[t.pVariant:t.pExt]
}

// variantOrPrivateTagStr returns variants or private use tags.
func (t unfold5__Tag) variantOrPrivateTagStr() string {
	if t.pExt > 0 {
		return t.str[t.pVariant:t.pExt]
	}
	return t.str[t.pVariant:]
}

// equalsRest compares everything except the language.
func (a unfold5__Tag) equalsRest(b unfold5__Tag) bool {
	// TODO: don't include extensions in this comparison. To do this efficiently,
	// though, we should handle private tags separately.
	return a.script == b.script && a.region == b.region && a.variantOrPrivateTagStr() == b.variantOrPrivateTagStr()
}

// isExactEquivalent returns true if canonicalizing the language will not alter
// the script or region of a tag.
func unfold5__isExactEquivalent(l unfold5__langID) bool {
	for _, o := range unfold5__notEquivalent {
		if o == l {
			return false
		}
	}
	return true
}

var unfold5__notEquivalent []unfold5__langID

func unfold5__init() {
	// Create a list of all languages for which canonicalization may alter the
	// script or region.
	for _, lm := range unfold5__langAliasMap {
		tag := unfold5__Tag{lang: unfold5__langID(lm.from)}
		if tag, _ = tag.canonicalize(unfold5__All); tag.script != 0 || tag.region != 0 {
			unfold5__notEquivalent = append(unfold5__notEquivalent, unfold5__langID(lm.from))
		}
	}
	// Maximize undefined regions of paradigm locales.
	for i, v := range unfold5__paradigmLocales {
		max, _ := unfold5__addTags(unfold5__Tag{lang: unfold5__langID(v[0])})
		if v[1] == 0 {
			unfold5__paradigmLocales[i][1] = uint16(max.region)
		}
		if v[2] == 0 {
			unfold5__paradigmLocales[i][2] = uint16(max.region)
		}
	}
}
